    false,nt"url": null,nt"notes": "Zooplankton, chemical and other data were
    collected from bottle and net cast from BOCAS DE CENIZA from the SE Pacific (limit-140).
    Data were collected by the Inter-American Tropical Tuna Commission from 18 February
    1966 to 06 March 1966. Zooplankton data include displaced volume and taxonomic name.
    Chemical data include water temperature, salinity, oxygen, phosphate, silicate,
    nitrite, chlorophyll a, phaeopigments, and nitrate. Other data include air temperature,
    relative humidity, barometric pressure, cloud amount, cloud type, wind speed, wind
    direction, and water transparency. Data are in a comma separated value (.csv) format.
    Additional funding for digitizing historic data were provided by the Global Ocean
    Data Archaeology and Rescue (GODAR) project.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
